@-moz-document url-prefix("https://web.roblox.com"), url-prefix("https://www.roblox.com") {
  .ad, .ad *, .img_ad, .ad-annotations, #google_image_div, #aw0, #AdvertisingLeaderboard, .abp .UpsellAdButton, .abp .UpsellAdButton:link, .abp .UpsellAdButton:visited, .abp .BadAdButton, .abp .BadAdButton:link, .abp .BadAdButton:visited, .abp .ad-identification-text, a.ad img, .abp, .profile-ad /* This was slightly modified by DittoDino aka BoopBop, this is a form of credits to indicate who copied this code*/
  {
    visibility: hidden !important;
  } 
  body
  {
    background: transparent !important;
  }

  .content
  {
    background: transparent !important;
  }
  .container-footer
  {
    position:static !important;     
  }

  html
  {
    width: 100% !important;
    height: 100% !important;
    /*background-image: url(https://wallpapers-all.com/uploads/posts/2016-11/28_akame_ga_kill.jpg) !important;*/
      /* Background */
    background-size: cover !important;
    background-attachment: fixed !important;
    background-image: url(https://wallpapers-all.com/uploads/posts/2016-11/28_akame_ga_kill.jpg) !important;
  }

  .dark-theme .section-content
  {
    background-color: #a51c1b;
    color: #fff;
  }

  .dark-theme .rbx-tab .rbx-tab-heading
  {
    background-color: #a51c1b;
    color: #fff;
  }

  .dark-theme .rbx-tabs-horizontal .nav-tabs
  {
    background-color: #a51c1b;
    color: #fff;
  }

  .dark-theme .rbx-tabs-horizontal .rbx-tab.active .rbx-tab-heading
  {
    color: #fff;
    background-color: transparent;
    box-shadow: inset 0 -4px 0 0 #000;
  }

  .dark-theme .text, .dark-theme .text-date-hint, .dark-theme .text-default, .dark-theme .text-description, .dark-theme .text-footer, .dark-theme .text-info, .dark-theme .text-label, .dark-theme .text-secondary, .dark-theme p /* This was slightly modified by DittoDino aka BoopBop, this is a form of credits to indicate who copied this code*/
  {
    color: #ffffff;
  }

  .dark-theme .profile-avatar-right .profile-avatar-mask
  {
    background-color: #a51c1b;
    color: #fff;
  }

  .profile-avatar-left .enable-three-dee
  {
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    border: 1px solid black;
    background-color: #ffffff00;
    border-color: #000000;
    color: #000000;
    cursor: pointer;
    display: inline-block;
    font-weight: 500;
    height: auto;
    text-align: center;
    white-space: nowrap;
    vertical-align: middle;
    padding: 9px 9px;
    font-size: 16px;
    line-height: 100%;
    border-radius: 1px;
    position: absolute;
    top: 12px;
    right: 12px;
    min-height: 32px;
  }

  .dark-theme .profile-accoutrements-container .profile-accoutrements-slider .accoutrement-item a
  {
    background-color: #b32524;
  }


  .dark-theme .slide-switcher .slide-item-container .slide-item-container-right
  {
    background-color: #b32524;
    color: #fff;
  }

  .dark-theme .slide-switcher .slide-item-container .slide-item-container-left
  {
    background-color: #a51c1b;
  }

  #chat-header, .mCSB_container *, .mCSB_draggerContainer, .mCustomScrollBox
  {
    background-color: #a51c1b;
    color: #000000;
  }

  #navigation
  {
    box-shadow: 0 0 8px 0 #00000096;
    background-color: #a51c1bb0;
  }

  #header
  {
    background-color: #a51c1b;
    border: solid #a51c1b00;
    border-width: 0 0 1px;
    box-shadow: 0 0 8px 0 #00000096;
  }
/* This was slightly modified by DittoDino aka BoopBop, this is a form of credits to indicate who copied this code*/

}
